import React from 'react';

const Peopleinfo = ({ name, birth_year, height, mass }) => {
    return (
        <div className="row">
            <div className="col s12 m7">
                <div class="card-image">
                    <div className='card'>
                        <img src="./swicon.png" alt="Star War" />
                        <div className="center card-title">
                            <h3>{name}</h3>
                            <p>{birth_year}</p>
                            <p>{height}</p>
                            <p>{mass}</p>
                        </div>
                    </div>
                </div>
            </div> 
        </div>

    );
}

export default Peopleinfo;
